package de.signWritingEditor.shared.badge.model.material;

import static de.signWritingEditor.shared.i18n.I18NAccess.I18N;

import java.util.Date;

import de.badge.shared.model.domainValue.BadgeLevel;
import de.jsonParser.shared.infrastructure.JsonParser;
import de.signWritingEditor.shared.badge.model.domainValue.DelegsBadgeType;

public class LocalSignCreatorBadge extends DelegsBadge {

	public static final JsonBlankFactory<LocalSignCreatorBadge> JSON_BLANK_FACTORY = new JsonBlankFactory<LocalSignCreatorBadge>() {
		@Override
		public LocalSignCreatorBadge doCreateJsonBlank() {
			return new LocalSignCreatorBadge();
		}
	};

	private static final long serialVersionUID = -7427609742522443219L;
	private static final DelegsBadgeType BADGE_TYPE = DelegsBadgeType.LOCAL_SIGN_CREATOR;

	private static final String BRONZE_BADGE_IMAGE = "data:image/png;base64,";
	private static final String SILVER_BADGE_IMAGE = "data:image/png;base64,";
	private static final String GOLD_BADGE_IMAGE = "data:image/png;base64,";

	private static final int BRONZE_REQUIRED_SIGNS = 3;
	private static final int SILVER_REQUIRED_SIGNS = 10;
	private static final int GOLD_REQUIRED_SIGNS = 45;

	private int signsCreated;

	public LocalSignCreatorBadge(String ownername, Date dateEarned, int signsCreated) {
		super(ownername, BADGE_TYPE, dateEarned);
		this.signsCreated = signsCreated;

		doConsistencyCheck();
	}

	public LocalSignCreatorBadge(String ownername) {
		this(ownername, null, 0);
	}

	@Deprecated
	private LocalSignCreatorBadge() {
		super();
	}

	@Override
	public String getTitle() {
		return I18N.getLocalSignCreatorBadgeTitle();
	}

	@Override
	public String getDescription() {
		return I18N.getLocalSignCreatorBadgeDescription();
	}

	@Override
	public String getStatus() {
		String result = I18N.getBadgeStatusForHighestRank();

		BadgeLevel level = getCurrentLevel();
		if (level == BadgeLevel.NONE) {
			result = I18N.getLocalSignCreatorBadgeStatusForNone(getMissingSignsForNextBadge());
		} else if (level == BadgeLevel.BRONZE) {
			result = I18N.getLocalSignCreatorBadgeStatusForBronze(getMissingSignsForNextBadge());
		} else if (level == BadgeLevel.SILVER) {
			result = I18N.getLocalSignCreatorBadgeStatusForSilver(getMissingSignsForNextBadge());
		}

		return result;
	}

	public boolean userCreatedSign() {
		boolean newBadgeReceived = false;

		BadgeLevel oldLevel = getCurrentLevel();
		signsCreated++;
		BadgeLevel newLevel = getCurrentLevel();
		if (newLevel != oldLevel) {
			setDateEarned(new Date());
			newBadgeReceived = true;
		}

		return newBadgeReceived;
	}

	@Override
	public BadgeLevel getCurrentLevel() {
		if (signsCreated >= GOLD_REQUIRED_SIGNS) {
			return BadgeLevel.GOLD;
		}
		if (signsCreated >= SILVER_REQUIRED_SIGNS) {
			return BadgeLevel.SILVER;
		}
		if (signsCreated >= BRONZE_REQUIRED_SIGNS) {
			return BadgeLevel.BRONZE;
		}
		return BadgeLevel.NONE;
	}

	@Override
	protected String getBronzeBadgeAsBase64() {
		return BRONZE_BADGE_IMAGE;
	}

	@Override
	protected String getSilverBadgeAsBase64() {
		return SILVER_BADGE_IMAGE;
	}

	@Override
	protected String getGoldBadgeAsBase64() {
		return GOLD_BADGE_IMAGE;
	}

	@Override
	protected void setJson(JsonParser jsonParser) {
		assert jsonParser != null : "Precondition failed: jsonParser != null";

		super.setJson(jsonParser);

		signsCreated = readIntFromJson(jsonParser, "signsCreated");
	}

	@Override
	protected String getJson() {
		StringBuilder result = new StringBuilder(super.getJson());

		writeIntToJson(result, "signsCreated", signsCreated);

		assert result != null : "Postcondition failed: result != null";
		return result.toString();
	}

	private long getMissingSignsForNextBadge() {
		BadgeLevel currentLevel = getCurrentLevel();
		assert currentLevel != BadgeLevel.GOLD : "Precondition failed: assert currentLevel != BadgeLevel.GOLD";

		long result = -1;
		switch (currentLevel) {
		case NONE:
			result = BRONZE_REQUIRED_SIGNS - signsCreated;
			break;
		case BRONZE:
			result = SILVER_REQUIRED_SIGNS - signsCreated;
			break;
		case SILVER:
			result = GOLD_REQUIRED_SIGNS - signsCreated;
			break;
		case GOLD:
		default:
			throw new RuntimeException("you cannot call getMissingSignsForNextBadge() for level " + currentLevel);
		}

		assert result > 0 : "Postcondition failed: result > 0";
		return result;
	}
}
